import React from 'react';
import { fade, makeStyles } from '@material-ui/core/styles';
import {Button,Toolbar,IconButton,Typography,InputBase,Badge,ButtonBase,FormControl,NativeSelect,Box,Divider, Grid, CardActions,Card,CardMedia, CardContent} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  ban1: {
      width: "100%",
      height: "390px",
  }
}));


export default function CarD(props) {
  const classes = useStyles();
  
  return (
      <React.Fragment>
    <div className={classes.grow}>  
        <Grid item xs={3} key={props.key}>
            <Card>
                <CardMedia component="img" image={props.image}></CardMedia>
                <CardContent>
                    <Typography>{props.title}</Typography>
                    <Typography>{props.price}</Typography>
                </CardContent>
                <CardActions>
                    <Button variant="contained" color="primary">+</Button>
                    <Button variant="contained" color="secondary">-</Button>
                </CardActions>
            </Card>
        </Grid>
    </div>
    </React.Fragment>
  );
}
